 class Counter extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             count: 0
        }
    }
    
    render() {
        return (
            <div>
               <div>count - {this.state.count}</div>
               <button>Increament</button>
            </div>
        )
    }
}

export default Counter
